	(1, 'Property', '2015-03-12 00:17:17', '2024-12-13 09:08:49', 'Full House Full Spec Full Reyen', 990.00, 6, 2, 1, 3, 64, '2015-07-23', '2015-07-23', '<p>Welcome to your dream home! This brand-new house offers a modern minimalist design that combines style and functionality. Perfectly crafted to meet the needs of modern families, it features:</p><ul>\n<li>A sleek, minimalist architectural style</li>\n<li>A convenient carport for vehicle storage</li>\n<li>Efficient and well-thought-out interior layouts</li>\n<li>High-quality materials and finishes</li>\n</ul><p>Located in a strategic area, the house is close to essential public amenities, including schools, hospitals, and shopping centers. The neighborhood is peaceful, secure, and ideal for families seeking comfort and convenience.</p><p>Don\'t miss out on this opportunity to own a high-quality home at a competitive price. Contact us today to schedule a viewing or for more details.</p><p><strong>Your new home awaits!</strong></p>', 1, 'full-house-full-spec-full-reyen', 6, 75, 180, 'I am offering a brand-new house featuring a sleek minimalist design, complete with a convenient carport. This home is thoughtfully designed to meet the needs of modern families, with efficient layouts and an appealing aesthetic. Strategically located near public amenities, it is situated in a peaceful and secure neighborhood. An ideal choice for those seeking a high-quality home at a competitive price.', 'Jalan Keabadian Nomor 999 Blok 72 B RT 32913 RW 2', NULL, NULL, NULL, 1),
